In case some of you don‚Äôt know anything about Mauritius, Mauritius is a beautiful African island nation, located almost 2000 kilometres off of the eastern coast of Africa, in the Indian Ocean. It was an uninhabited island until the 16th century, and became a sugar colony for the Portuguese, French, and later the British. Mauritius declared independence from the United Kingdom in 1968.In 52 years of independence, only 4 families have occupied the political scene. And political power has been trasmitted from father to son. Despite being one of the most stable African nations, with a strong island economy, Politicians have stolen billions and billions from this beautiful country . Mauritius is starting to be bled dry by the current government, implementing new projects that will cost only a few million and over estimating costs to finance their corruption as well as heavily borrowing from other countries, effectively selling off their country. Many of the high ranking public officials come from the same families and are facilitating these problems . According to some Mauritians who were interviewed, the current prime minster has been elected in rather shady way. ‚Äúon our last election many people have not been able to vote as they were not on the electoral list. It has been reported that at least 30% of the population was not the electoral list. I have many family members and my own mum that could not vote‚Äù. The tipping point (quite literally) came with an oil spill that happened recently. If you don't know recently a bulk japaneese carrier "wakashio" spilled oil in the lagoon of Mauritius casuing the worst environmental disaster ever in Mauritian history. This is the event that lead to the mass protests shown in the video above. As the person who recorded that video said, ‚Äúour government did nothing and  it's the population that helped to clean the mess.‚Äù According to Independent Mauritian news networks and witnesses to the protests, some disputed evidence has shown that the bulk carrier was in the lagoon for drug trafficking. This continues to add to the current saga unfolding in Mauritius.
